// set the dimensions and margins of the graph  
const width = 1800;  
const height = 900;  
const margin = 10;  
const radius = Math.min(width, height) / 2 - margin;  

const d3 = require("d3");  
const D3Node = require("d3-node");  
const d3n = new D3Node();  
const svg = d3n.createSVG(width, height)  
    .append("g")  
    .attr("transform", "translate(" + width / 2 + "," + height / 2 + ")");  

let data_transformed = {};  
data.forEach(d => {data_transformed[d.x] = {"y": d.y, "v": d.z}});  

// set the color scale  
var color = d3.scaleOrdinal()  
    .domain(Object.keys(data_transformed))  
    .range(["#427d93", "#4c835b", "#89733e", "#ca4d3b", "#846a91", "#4f7d7b", "#aa643b", "#a26472", "#587a86", "#5e7d4f", "#c04f4f"]);  

// Compute the position of each group on the pie:  
var pie = d3.pie()  
    .sort(null) // Do not sort group by size  
    .value(function(d) {return d.value.y; })  
    .startAngle(-Math.PI/8)  
    .endAngle(15 * Math.PI / 8)  
    ;  

var data_ready = pie(d3.entries(data_transformed));  
// The arc generator  
var arc = d3.arc()  
    .innerRadius(radius * 0.35)         // This is the size of the donut hole  
    .outerRadius(radius * 0.8)  
    ;  
// Another arc that wont be drawn. Just for labels positioning  
var outerArc = d3.arc()  
    .innerRadius(radius * 0.9)  
    .outerRadius(radius * 0.9)  
    ;  
// Another arc that wont be drawn. Just for labels positioning  
var outerArc2 = d3.arc()  
    .innerRadius(radius * 0.8)  
    .outerRadius(radius * 0.8)  
    ;  
// Build the pie chart: Basically, each part of the pie is a path that we build using the arc function.  
svg.selectAll("allSlices")  
    .data(data_ready)  
    .enter()
    .append("path")  
    .attr("d", arc)  
    .attr("fill", function(d){ return(color(d.data.key)) })  
    .attr("stroke", "white")  
    .style("stroke-width", "2px") 
    //.style("opacity", 0.7)  
    ;  

// Add the polylines between chart and labels:  
svg.selectAll("allPolylines")  
    .data(data_ready)  
    .enter()  
    .append("polyline")  
        .attr("stroke", "#888")  
        .style("fill", "none")  
        .attr("stroke-width", 1)  
        .attr("points", function(d) {  
            if(d.endAngle - d.startAngle<4*Math.PI/180){return []}
        var posA = outerArc2.centroid(d) // line insertion in the slice  
        var posB = outerArc.centroid(d) // line break: we use the other arc generator that has been built only for that  
        var posC = outerArc.centroid(d); // Label position = almost the same as posB  
        var midangle = d.startAngle + (d.endAngle - d.startAngle) / 2 // we need the angle to see if the X position will be at the extreme right or extreme left  
        posC[0] = radius * 0.95 * (midangle % (2 * Math.PI) < Math.PI ? 1 : -1); // multiply by 1 or -1 to put it on the right or on the left  
        return [posA, posB, posC]  
        });  

// Add labels:  
svg.selectAll("allLabels")  
    .data(data_ready)  
    .enter()  
    .append("text")  
        .attr("font-family", "Oracle Sans")  
        .attr("font-size", "24px")  
        .text( function(d) { 
            if(d.endAngle - d.startAngle<4*Math.PI/180){return ""}
            return d.data.key } )  
        .attr("transform", function(d) {  
            var pos = outerArc.centroid(d);  
            var midangle = d.startAngle + (d.endAngle - d.startAngle) / 2  
            pos[0] = radius * 0.99 * (midangle % (2 * Math.PI) < Math.PI ? 1 : -1);  
            return "translate(" + pos + ")";  
        })  
        .style("text-anchor", function(d) {  
            var midangle = d.startAngle + (d.endAngle - d.startAngle) / 2  
            return (midangle % (2 * Math.PI) < Math.PI ? "start" : "end")  
        });  

// Add values:  
svg.selectAll("allValues")  
    .data(data_ready)  
    .enter()  
    .append("text")  
        .attr("font-family", "Oracle Sans")  
        .attr("font-size", "24px")  
        .attr("fill", "#fff")
        .text( function(d) { 
            if(d.endAngle - d.startAngle<8*Math.PI/180){return ""}
            return d.data.value.v } )  
        .attr("transform", function(d) {  
            var pos = arc.centroid(d);  
            pos[0] -= 6 * d.data.value.v.length;
            pos[1] += 12
            return "translate(" + pos + ")";  
        })
        ;
return d3n;  
fail(new Error("We are missing something!"));
